import Products from "../Products/Products";
import "./Category.scss";
const Category = () => {
  return (
    <div className="category-main-content">
      <div className="layout">
        <div className="category-title">Category Title</div>
        <Products />
      </div>
    </div>
  );
};

export default Category;
